PREFIX : <http://lumii.lv/ontologies/UnivExample.owl#>
SELECT (COUNT(?Student) AS ?count_student) WHERE{
  ?Student a :Student.
  ?Course a :Course.
  ?Student :takes ?Course.
  {
    ?Course :courseName ?courseName.
    FILTER(STR(?courseName) = "Programming Basics")
  }
  UNION
  {
	?Course :courseName ?courseName.
    FILTER(STR(?courseName) = "Programming Languages")
  }
}

